import React from 'react';
import './App.css';
function Hello() {
  function formatName(user) {
    return user.firstName + ' ' + user.lastName;
  }

  const user = {
    firstName: 'Harper',
    lastName: 'Perez'
  };

  return <h1 className="HelloBox">Hello, {formatName(user)}!</h1>;
}
export default Hello;
